                var html_029a6fb14a4faf964165fb7e35c11596 = $(`<div id="html_029a6fb14a4faf964165fb7e35c11596" style="width: 100.0%; height: 100.0%;"><div style="font-size: 15px;"><b>Αρχαία Οχύρωση</b>: Τα τείχη της αρχαίας πόλης ξεκινούν από την ακρόπολη σε δύο βραχίονες που ακολουθούν τις διακυμάνσεις του εδάφους και περιέκλειαν την πόλη σε μια έκταση 305 στρεμάτων. Το τείχος είναι χτισμένο κατά το ισόδομο και ψευδοϊσόδομο τραπεζιόσχημο σύστημα, με δύο σειρές λαξευμένων ορθογώνιων λιθοπλίνθων από ντόπια πέτρα, που σχηματίζουν τις δύο κυρίως όψεις του και απλό γέμισμα από μικρές αδούλευτες πέτρες και χώμα στο εσωτερικό του. Κατά διαστήματα ενισχυόταν με ορθογώνιους και ημικυκλικούς πύργους. Το μήκος του υπολογίζεται κατά προσέγγιση στα 2,5 χιλιόμετρα.</div><br><br><div style="text-align: right;"><small>&#x1F4D6; Τσαρούχα Α., Η αρχαία Άμφισσα και η Οχύρωση της, Πρακτικά Επιστημονικού Συνεδρίου, Άμφισσα 22,23 και 24 Νοεμβρρίου 2013, επιμ. Μαρία Φωτεινή Παπακωνσταντίνου, Έκδοση 24ης Εφορείας Βυζαντινών Αρχαιοτήτων, Άμφισσα, 2014, σ.37-49 Καζάκου Μ.Κ., Τα ειδώλια του «Αποθέτη της Παιδικής Χαράς» στην Πόλη της Άμφισσας. Συμβολή στην Κοροπλαστική της Δυτικής Λοκρίδος, Πανεπιστήμιο Θεσσαλίας, Τμήμα Ιστορίας, Αρχαιολογίας και Κοινωνικής Ανθρωπολογίας, Βόλος 2020, σ.22-25 Lerat L., Εσπέριοι Λοκροί Τόμος Ι, Τοπογραφία και Ερείπια, μτφρ. Καραμπέτσου Β.- Χατζηβασιλείου Δ., Άμφισσα 2008, σ. 264-271</small></div></div>`)[0];

                var html_38471f7387ba78fe31e84b1f9502923b = $(`<div id="html_38471f7387ba78fe31e84b1f9502923b" style="width: 100.0%; height: 100.0%;"><div style="font-size: 15px;"><b>Αρχαίο Κάστρο</b>: Η σημερινή μορφή του Κάστρου αποτελείται από κτίσματα που χρονολογούνται από την κλασική περίοδο μέχρι την τουρκοκρατία. Αποτελείται από δύο οχυρούς περιβόλους, με τον πρώτο να βρίσκεται στα ΝΑ και να ακολουθεί τη φυσική μορφολογία του εδάφους ενώ ο δεύτερος περιβάλλει το υψηλότερο επίπεδο του λόφου στα ΒΔ. Συνολικά διακρίνουμε τρείς οικοδομικές φάσεις του οχυρωματικού περιβόλου της ακροπόλης - κάστρου. Πρώτη φάση τον 6ο αι. π.Χ. με το πολυγωνικό σύστημα δόμησης. Πρέπει να διατηρήθηκε μέχρι τον 338 π.Χ. οπότε και καταστράφηκε από τον Φίλιππο Β' της Μακεδονίας. Δεύτερη φάση στα τέλη 4ου αι. π.Χ. - αρχές 3ου αι. π.Χ. με το ισόδομο τραπεζιόσχημο σύστημα δόμησης ενσωματώνοντας και σωζόμενα αρχαιότερα τμήματα. Τρίτη φάση 1204-5, 1210-11 είτε με την επανάχρηση αρχαίου υλικού με χρήση κονιάματος αναμεμειγμένου με μικρές πέτρες και κομμάτια κεραμίδων είτε από μικρές πέτρες και κομμάτια κεραμίδων συνδεδεμένων με κονίαμα. Στη βάση της ΒΔ και ΝΑ πλευράς διατηρούνται τμήματα της αρχαίας οχύρωσης κατά το ισόδομο ορθογώνιο και τραπεζιόσχημο σύστημα. Η ανατολική και η νότια πλευρά ανήκουν κυρίως στη μεσαιωνική φάση.</div><br><br><div style="text-align: right;"><small>&#x1F4D6; Το Κάστο των Σαλώνων (Άμφισσας) Ιστορική Διαδρομή - Δυνατότητες και Προοπτική Ανάδειξης , Πρακτικά Επιστημονικού Συνεδρίου, Άμφισσα 22,23 και 24 Νοεμβρρίου 2013, επιμ. Μαρία Φωτεινή Παπακωνσταντίνου, Έκδοση 24ης Εφορείας Βυζαντινών Αρχαιοτήτων, Άμφισσα, 2014, σ.19-32 Καλονάρου Π., Ιστορία της Πόλεως Αμφίσσης, Σύλλογος Απανταχού Αμφισσέων - Τα Σάλωνα- Άμφισσα 1997, απόδοση: Κωνσταντίνα Βάρσου, Τόμος 1, σ. 41-47 Lerat L., Εσπέριοι Λοκροί Τόμος Ι, Τοπογραφία και Ερείπια, μτφρ. Καραμπέτσου Β.- Χατζηβασιλείου Δ., Άμφισσα 2008, σ. 264-271</small></div></div>`)[0];

            var fast_marker_cluster_b65b2c5276e9e2cdcbd19bca3ae11be3 = (function(){
                
                var callback = function (row) {
                    var icon = L.AwesomeMarkers.icon();
                    var marker = L.marker(new L.LatLng(row[0], row[1]));
                    marker.setIcon(icon);
                    return marker;
                };

                var data = [];
                var cluster = L.markerClusterGroup({"showCoverageOnHover": false, "spiderfyOnMaxZoom": true, "zoomToBoundsOnClick": true});

                for (var i = 0; i < data.length; i++) {
                    var row = data[i];
                    var marker = callback(row);
                    marker.addTo(cluster);
                }

                cluster.addTo(feature_group_770062b6d7d59b6ebea63fe3d2771706);
                return cluster;
            })();
